css:
@-moz-document domain("livesportstreaming24.com") {
#timing>table {
    width: 100%;
    height: 630px;
    font-weight: bold;
    padding: 10px;
    font: 100%;
}
#timing>table td {
    width: 80%;
}
.header,.main {
    display: none;
}
div#timing {
    color: #fff;
    font-family: sans-serif;
    line-height: 85%;
    overflow-x: visible;
    overflow-y: visible;
    margin-left: 0em;
}
div#timing tr td:nth-child(1) {
    position: relative;
    left: 0.0em;
    width: 0.0em;
}
div#timing tr td:nth-child(2) {
    position: relative;
    left: 0.0em;
    width: 0em;
}
div#timing tr td:nth-child(3) {
    position: relative;
    left: 0.0em;
    width: 0em;
}
div#timing tr td:nth-child(4) {
    position: relative;
    left: 0.0em;
    width: 0em;
}
}
